const QUALITY = require('./QUALITY');

const QUALITY_TOKENS = {
    [QUALITY.ROOKIE]: 'SNAKOIL',
    [QUALITY.INTERMEDIATE]: 'SNAKGAS',
    [QUALITY.VETERAN]: 'SNAKPOW',
    [QUALITY.MASTER]: 'SNAKVEN',
};

module.exports = QUALITY_TOKENS;
